import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // --- Rapidly add multiple items to the cart using page.evaluate ---
    const productIdsToAdd = [1, 2, 3, 4, 5];
    for (const id of productIdsToAdd) {
      await page.evaluate(productId => {
        // @ts-ignore
        addToCart(productId);
      }, id);
    }

    // Wait for the cart counter to update
    await page.waitForFunction(() => document.getElementById('cartCount')?.textContent?.trim() === '5');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_items_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_items_added.png'));

    // --- Open the cart modal ---
    await page.locator('div.cart').first().click();
    await page.waitForSelector('#cartModal .cart-item', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_open.png'));

    // --- Rapidly manipulate quantities ---
    await page.evaluate(() => {
      // @ts-ignore
      updateCartQuantity(1, 3); // Update product 1 quantity to 3
      // @ts-ignore
      updateCartQuantity(2, 5); // Update product 2 quantity to 5
    });

    // Wait for a quantity to reflect the change
    await page.waitForFunction(() => {
        const item = document.querySelector('.cart-item'); // Check first item
        return item?.querySelector('.quantity')?.textContent?.trim() === '3';
    });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_quantities_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_quantities_updated.png'));

    // --- Rapidly remove an item ---
    await page.evaluate(() => {
      // @ts-ignore
      removeFromCart(4); // Remove product with ID 4
    });

    // Wait for the item to be removed from the DOM
    await page.waitForSelector('#cartModal .cart-item', { state: 'hidden', timeout: 5000 });
    await page.waitForSelector('#cartModal .cart-item', { state: 'visible', timeout: 5000 }); // Wait for re-render
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_item_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_item_removed.png'));

    // --- Extract final cart state for verification ---
    const finalCartCounter = await page.locator('#cartCount').textContent();
    const finalItemCountInModal = await page.locator('#cartModal .cart-item').count();
    const finalCartTotal = await page.locator('#cartTotal').textContent();

    const extractedData = {
      finalCartCounter: finalCartCounter.trim(),
      finalItemCountInModal,
      finalCartTotal: `$${finalCartTotal.trim()}`
    };

    return {
      success: true,
      action: "Performed a rapid cart manipulation stress test: added, updated, and removed items.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to perform cart manipulation stress test",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
